package aqqje.com.beans.contollers;import aqqje.com.beans.Persion;import java.util.List;public class God {    private String name;    private int leg;    private List<Persion> persion;    public God() {    }    public God(String name, int leg, List<Persion> persion) {        this.name = name;        this.leg = leg;        this.persion = persion;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public int getLeg() {        return leg;    }    public void setLeg(int leg) {        this.leg = leg;    }    public List<Persion> getPersion() {        return persion;    }    public void setPersion(List<Persion> persion) {        this.persion = persion;    }    @Override    public String toString() {        return "God{" +                "name='" + name + '\'' +                ", leg=" + leg +                ", persion=" + persion +                '}';    }}